import re
import pandas as pd
import os
def extract_folder_paths(input_strings):
    folder_paths = []
    for line in input_strings:
        match = re.search(r"File: (.+?) Shape:", line)
        if match:
            path = match.group(1).strip()
            folder_path = os.path.dirname(path)  # Get the folder path
            folder_paths.append(folder_path)
    return folder_paths

# Extract folder paths from input strings
folder_paths = extract_folder_paths(input_strings)

# Read the CSV file
df = pd.read_csv('mfcc_all_paths_and_labels.csv', header=None, names=['path', 'label'])

# Filter out rows where the path matches any of the extracted folder paths
filtered_df = df[~df['path'].apply(lambda x: any(folder_path in x for folder_path in folder_paths))]

# Save the updated DataFrame back to the CSV
filtered_df.to_csv('all_paths_and_labels.csv', index=False, header=False)

print("Filtered CSV file has been saved.")